import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

class Home extends React.Component {
    render() {
        return (
            <div >
                <h1>Home Page</h1>
                <div>
                    <input />
                </div>
            </div>
        );
    }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Home />);
